# A Comparison of Linear Mixed Model Packages in R for Analysis of Plant Breeding Experiments
### Sam Rogers and Dr Julian Taylor
### samrogers.website/talks/YSC2019.html
### 01 October 2019

---


class: center, middle
# Introduction






---

# The Problem

- Comparing `ASReml-R` to other linear mixed model (LMM) software for the purposes of plant breeding.


- Are there other **mature** packages with the capabilities of `ASReml-R` (or close enough)?
  - Bonus points for free/open source.


- How do they compare?
  - Performance (speed) and features

&lt;br&gt;&lt;br&gt;
We compared 3 R packages with a focus on computational aspects of large scale genomic selection LMMs.


???

How do other people analyse plant breeding trials?  
What software do they use?  
Is it capable? Is it easy to use?

---

# Motivating Data

- Phenotypic data from an Australia Grains Technologies (AGT) field trial in SA.

- Full trial was 10375 varieties unreplicated + 6 check varieties with 150+ reps
  - Full details in Norman, et al. (2017)
  
- Genotypic data consisting of 17171 genetic markers from a 20K Affymetrix array
  - Reduced to 3000/6000 markers for this analysis.

- We looked at rectangular subsets of the field trial, that were equivalent to `\(n_g \approx (100, 200, 500, 1000, 2000, 3000, 4000, 5000)\)`, `\(n_g\)` being the number of varieties.

???
zadoks score is to do with plant maturity
Typically early field trials use a large number of varieties which are then reduced to much fewer for future trials

sommer = *So*lving *M*ixed *M*odel *E*quations in *R*

&lt;!-- ## `lme4` (+ `pedigreemm`) --&gt;

&lt;!-- - Mature LMM package --&gt;
&lt;!--   - First released on CRAN in ~2003   --&gt;
&lt;!--   - References to S/S-PLUS before then --&gt;

&lt;!-- - Widely used with ~25k citations between (Bates, et al., 2007),  (Bates, et al., 2015) and (Vazquez, et al., 2010) --&gt;
&lt;!--   - Including ~1200 in Nature, TAG, and other Plant Breeding Journals. --&gt;

&lt;!-- - `pedigreemm` package adds functions to manipulate pedigrees and incorporate these relationships into an LMM --&gt;
&lt;!--   - designed for animal breeding --&gt;


&lt;!-- --- --&gt;
&lt;!-- # The contenders --&gt;
&lt;!-- ## `ASReml-R` --&gt;

&lt;!-- - Another mature&lt;sup&gt;*&lt;/sup&gt; LMM package and what we typically use --&gt;

&lt;!-- - ~4.5k citations between  and (Butler, Cullis, Gilmour, and Gogel, 2009) and a few others --&gt;
&lt;!--  - Proportionally more commonly used in Plant Breeding Journals (~10% of citations, vs ~5%). --&gt;


&lt;!-- .footnote[[*] Unless you&#39;re trying to install it...] --&gt;

&lt;!-- --- --&gt;
&lt;!-- # The contenders --&gt;
&lt;!-- ## `Sommer` --&gt;

&lt;!-- - The &quot;new kid on the block&quot; - released 2014 --&gt;
&lt;!-- - Very similar syntax to ASReml-R. --&gt;

&lt;!-- --- --&gt;

&lt;!-- # `lme4` vs `ASReml-R` major differences --&gt;

&lt;!-- .pull-left[ --&gt;
&lt;!-- #### LME4 --&gt;
&lt;!-- - No ability to specify residual correlation structures --&gt;
&lt;!-- - Open source --&gt;
&lt;!-- - Cannot incorporate marker based relationship matrices&lt;sup&gt;*&lt;/sup&gt; --&gt;
&lt;!-- - Limited variance structures available for random effects --&gt;
&lt;!-- - ... --&gt;

&lt;!-- ] --&gt;

&lt;!-- .pull-right[ --&gt;
&lt;!-- #### ASReml-R --&gt;

&lt;!-- - Can specify residual correlation structures   --&gt;
&lt;!-- - Closed source/proprietary --&gt;
&lt;!-- - Can incorporate marker based relationship matrices --&gt;
&lt;!-- - Flexible varaince structure available for random effects --&gt;
&lt;!-- - ... --&gt;

&lt;!-- ] --&gt;

&lt;!-- .footnote[[*] Without substantial hacks/workarounds in `pedigreemm`] --&gt;
&lt;!-- --- --&gt;

&lt;!-- # The (Base) Linear Mixed Model --&gt;

&lt;!-- For a given trait response vector `\(\boldsymbol{y}\)` of length `\(n\)` a baseline linear mixed model is of the form: --&gt;

&lt;!-- $$ --&gt;
&lt;!-- \boldsymbol{y} = \boldsymbol{X}\boldsymbol{\tau} + \boldsymbol{Z}\boldsymbol{u} + \boldsymbol{Z}_{g}\boldsymbol{g} + \boldsymbol{e} --&gt;
&lt;!-- $$ --&gt;
&lt;!-- where --&gt;

&lt;!-- - `\(\boldsymbol{\tau}\)` are fixed effects (`lrow`, `lrange`, `elev`) --&gt;
&lt;!-- - `\(\boldsymbol{u}\)` are the random effects (None in this case) --&gt;
&lt;!-- - `\(\boldsymbol{g}\)` is a set of genetic effects of length `\(g\)`, with design matrix `\(\boldsymbol{Z}_g\)`, assumed to be distributed `\(\boldsymbol{g} \sim N(\boldsymbol{0}, \sigma^2_g \boldsymbol{I}_g)\)` --&gt;
&lt;!-- - `\(\boldsymbol{e}\)` are residuals with assumed distribution `\(\boldsymbol{e} \sim N(\boldsymbol{0}, \sigma^2 \boldsymbol{R})\)` --&gt;
&lt;!--   - `\(\boldsymbol{R}\)` is the correlation structure of form `\(\boldsymbol{R} = \boldsymbol{\Sigma}_r \otimes \boldsymbol{\Sigma}_c\)` (separable autoregressive structure in row and col) --&gt;

&lt;!-- ??? --&gt;
&lt;!-- This model can&#39;t be fit in lme4 unless `\(R = \sigma^2 \boldsymbol{I}\)` --&gt;

# Genomic Selection LMM

For a trait response vector `\(\boldsymbol{y}\)` of length `\(n\)`, consider a genetic marker matrix `\(\boldsymbol{M}\)` (dimension `\(g \times r\)`) for varieties and the associated (mostly) additive relationship matrix `\(\boldsymbol{G}_a = \boldsymbol{M}\boldsymbol{M}^{T}\)`.

One specification of a LMM has the form 

$$
\boldsymbol{y} = \boldsymbol{X}\boldsymbol{\tau} + \boldsymbol{Z}\boldsymbol{u} + \boldsymbol{Z}_g\boldsymbol{a} + \boldsymbol{Z}_g\boldsymbol{r} + \boldsymbol{e}
$$

where

- `\(\boldsymbol{\tau}\)` are fixed effects 
- `\(\boldsymbol{u}\)` are the random effects (None in this case)
- `\(\boldsymbol{a}\)` is a set of additive variety effects with assumed distribution `\(\boldsymbol{a} \sim N(\boldsymbol{0}, \sigma^2_a \boldsymbol{G}_a)\)`
- `\(\boldsymbol{r}\)` are the polygenic non-additive genetic effects with assumed distribution `\(\boldsymbol{r} \sim N(\boldsymbol{0}, \sigma^2_r \boldsymbol{I}_g)\)`.
- `\(\boldsymbol{e}\)` are residuals with assumed distribution `\(\boldsymbol{e} \sim N(\boldsymbol{0}, \sigma^2 \boldsymbol{R})\)`

This can be fit in `asreml()` using the `vm()` (variance matrix) function and `sommer` using the `vs()` (variance structure) function.

---

# Genomic Selection LMM V2

The second specification of the LMM makes use of the Cholesky decomposition of the relationship matrix defined as `\(\boldsymbol{G}_a = \boldsymbol{L}\boldsymbol{L}^T\)`. 

The left Cholesky factor is incorporated into the LMM as

$$
\boldsymbol{y} = \boldsymbol{X}\boldsymbol{\tau} + \boldsymbol{Z}\boldsymbol{u} + \boldsymbol{Z}_g\boldsymbol{L}\boldsymbol{a^*} + \boldsymbol{Z}_g\boldsymbol{p} + \boldsymbol{e}
$$

where

- `\(\boldsymbol{a^*}\)` is a set of non-interpretable genetic effects with assumed distribution `\(\boldsymbol{a^*} \sim N(\boldsymbol{0}, \sigma^2_a \boldsymbol{I}_g)\)` which is the same additive genetic variance as in the previous model.
  - The additive genetic effects, `\(\boldsymbol{a}\)`, can be derived through back transformation.


Although they differ in their specification, the two models produce the same likelihood and estimate of `\(\sigma^2_a\)`.

This can be fitted using `pedigreemm()` by specifying the left Cholesky factor to be attached to `\(\boldsymbol{Z}_g\)`.

This can also be fitted with `asreml()` using the `mbf()` function.

---

# Genomic Selection Models in R

To specify these models in R, we use the following code:

##### `LME4`/`pedigreemm`

```r
pedigreemm(matzadoks ~ 1 + (1|GenotypeA) + (1|GenotypeR),
           data = temp.dat, pedigree = list(GenotypeA = relmat_p))
```

##### `ASReml-R`


```r
asreml(matzadoks ~ 1, random = ~ mbf(&quot;relM&quot;) + GenotypeR, data = temp.dat, 
       mbf = list(relM = list(key = c(&quot;GenotypeA&quot;, &quot;GenotypeA&quot;), cov = &quot;lchol&quot;)))
```


```r
asreml(matzadoks ~ 1, random = ~ vm(GenotypeA, relmat) + 
         GenotypeR, data = temp.dat)
```

##### `sommer`


```r
mmer(matzadoks ~ 1, random = ~vs(GenotypeA, Gu = relmat) + 
       GenotypeR, rcov = ~units, data = temp.dat, na.method.X = &quot;include&quot;)
```

# Making `pedigreemm` work

`pedigreemm` does not work with relationship matrices out of the box. So we had to trick it...


```r
relfactor &lt;- function(rel, labs){
    rel &lt;- unclass(rel)
    relf &lt;- chol(rel)
    dimnames(relf)[[1]] &lt;- dimnames(relf)[[2]] &lt;- labs
    relf
}

assignInNamespace(&quot;relfactor&quot;, relfactor, pos = &quot;package:pedigreemm&quot;)
```

# Summary and discoveries

`sommer` was the suprising winner by a huge margin 

- At least 9x faster than `ASReml-R` and `LME4`, and up to 160x faster in some cases
- Performance increases with CPU cores available due to parallel processing
- Has much of the same capability as `ASReml-R`, though is lacking in a few areas

It is *possible* to run genomic selection models in `lme4`, but less than ideal because:

- `lme4`/`pedigreemm` is substantially slower&lt;sup&gt;*&lt;/sup&gt;
- Major disadvantage of no residual correlation structures available
- Relationship matrix incorporation took substantial hacking
- `pedigreemm` not updated since 2014



.footnote[[*] except for small cases, but who cares about 0.5s vs 4s...]
